import React from 'react'

const parentDiv = {
    height: '100px',
    backgroundColor: 'lightblue',
    display: 'flex',
};

const header = {
    backgroundColor: 'red',
}
const Navbar = () => {
  return (
    <div style={parentDiv}>
        <div style={log}></div>
        <div style={otherPage}></div>
        <div style={auth}></div>
        Navbar
    </div>
  )
}

export default Navbar;
